import React, { Component } from 'react';
import InputGroup from 'react-bootstrap/InputGroup';
import { FormControl
 } from 'react-bootstrap';
 import Jumbotron from 'react-bootstrap/Jumbotron';
 import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
 import { faSearch } from '@fortawesome/free-solid-svg-icons'
 import '../assets/css/buscador.css'

class Buscador extends Component {


    busquedaRef = React.createRef();
    obtenerDatos = (e) => {
        e.preventDefault();
        console.log(this.busquedaRef.current.value);

    }

    render(){
        return ( 

           <Jumbotron className=" jum-style">
               <form>
                   <div className="row">
                       <div className="form-group col-md-8">
                           <input type="text" className="form-control form-control-lg" placeholder="Busca tu carrito babe">
                           </input>
                       </div>
                       <div className="form-group col-md-8">
                           <input type="submit" className="btn btm-lg btn-danger btn-block">
                           </input>

                       </div>
                   </div>
               </form>
               <h1 className="texto-buscador">Encuentra el Vehículo</h1>
               <form onSubmit={this.obtenerDatos}>
                <InputGroup className="mb-5 pad-j" size="lg" ref={this.busquedaRef} type="text">
                <FormControl
                    placeholder="Ingresa el número de placa"
                    aria-label="Recipient's username"
                    aria-describedby="basic-addon2"
                    className="redon"
                    type="text"
                />
                <InputGroup.Append >
                    <InputGroup id="basic-addon2"><FontAwesomeIcon icon={faSearch} className="color-icon" type="submit" value="Buscar" /></InputGroup>
                </InputGroup.Append>
                </InputGroup>
                </form>
           </Jumbotron>
        );
    }

}
export default Buscador;
